import React from 'react';
import LoadPage from './views/LoadPage';
import Logo from './components/Logo'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faHome, faCartArrowDown } from '@fortawesome/free-solid-svg-icons'


function App() {
  return (
    <header className="bg-gradient-to-b from-black to-gray-800 
                       flex
                       justify-center
                       h-24
                       pt-4 
                       shadow-xl
                       w-screen
    ">
      <div className="flex justify-between w-full" >
        <FontAwesomeIcon className="text-white text-3xl mt-3" icon={faHome} />
          <div className="mx-auto" >
            <Logo />
          </div>
          <FontAwesomeIcon className="text-white text-3xl mt-3" icon={faCartArrowDown} />
      </div>
    </header>
  );
}

export default App;
